import React from 'react';
import chair from "../../images/chair.png";
import "./NavMain.css";

const NavMain = () => {
    return (
        <main style={{height:"300px"}} className="row bg-dark">
            
            <div className="col-md-4 offset-md-1">
                <h2>New Smile <br/> starts from here</h2>
                <p className="text-secondary">Lorem ipsum dolor sit amet consectetur, adipisicing elit. Eius sit minus ipsa, omnis nostrum qui.</p>
                <button className="btn btn-primary">Get appointment</button>

            </div>
            <div  className="col-md-6 setTheBg">
                <img className="img-fluid" src={chair} alt=""/>

            </div>

           
        </main>
    );
};

export default NavMain;
